import React, { Component } from 'react';
import Particles from 'react-particles-js';
import Navigation from './components/Navigation/Navigation';
import Logo from './components/Logo/Logo';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Rank from './components/Rank/Rank';
import './App.css';
import 'tachyons';
import { render } from '@testing-library/react';



class App extends Component {
  constructor() {
    super();
    this.state = {
      input: '',
    }
  }
  onInputChange = (event) => {
    console.log(event.target.value);
  }
  onButtonSubmit = () => {
    console.log('click');
    app.models.predict("a7e6a87dc48542b79a7ac79d0cbb0a04", "https://samples.clarifi.com/face-det.jpg").then(
      function (response) {
        console.log('success');
      },
      function (err) {
        console.log('error');
      }
    );
  }


  render() {
    return (
      <div className="App">
        <Particles className="particles"></Particles>
        <Navigation></Navigation>
        <Logo></Logo>
        <ImageLinkForm onInputChange={this.onInputChange} onButtonSubmit={this.onButtonSubmit} ></ImageLinkForm>
        <Rank></Rank>
        {/* <FaceRecognition></FaceRecognition> */}

      </div>
    );
  }
}

export default App;
